// src/components/SideMenu.js
import React, { useState } from 'react';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, ListSubheader, Collapse } from '@mui/material';
import DashboardIcon from '@mui/icons-material/Dashboard';
import ViewColumnIcon from '@mui/icons-material/ViewColumn';
import TableChartIcon from '@mui/icons-material/TableChart';
import BuildIcon from '@mui/icons-material/Build';
import DateRangeIcon from '@mui/icons-material/DateRange';
import NoteAddIcon from '@mui/icons-material/NoteAdd';
import BookIcon from '@mui/icons-material/Book';
import ExpandLess from '@mui/icons-material/ExpandLess';
import ExpandMore from '@mui/icons-material/ExpandMore';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import { grey } from '@mui/material/colors';

const drawerWidth = 240;

const SideMenu = () => {
  const [open, setOpen] = useState(true);

  const handleClick = () => {
    setOpen(!open);
  };

  return (
    <Drawer
      variant="permanent"
      sx={{
        width: drawerWidth,
        flexShrink: 0,
        [`& .MuiDrawer-paper`]: { 
          width: drawerWidth, 
          boxSizing: 'border-box',
          bgcolor: grey[900], // You can adjust the grey scale as needed
        },
      }}
    >
      <List
        subheader={
          <ListSubheader component="div" id="nested-list-subheader" sx={{ bgcolor: grey[800] }}>
            My App
          </ListSubheader>
        }
        sx={{ color: grey[300] }} // Text color for the list items
      >
        <ListItem button>
          <ListItemIcon sx={{ color: grey[300] }}>
            <DashboardIcon />
          </ListItemIcon>
          <ListItemText primary="Dashboards" /> 
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <DashboardIcon />
          </ListItemIcon>
          <ListItemText primary="Files" />
        </ListItem>
      </List>
    </Drawer>
  );
};

export default SideMenu;
